import './css/App.css';
import { StudentView } from './pages/StudentView';
import { StaffView } from './pages/StaffView';
import { useLogsContext } from './hooks/useLogsContext'
import { useEffect } from 'react'

import { BrowserRouter, Routes, Route } from 'react-router-dom'

function App() {
  const { logs, dispatchLogs } = useLogsContext()

    useEffect(() => {
      const fetchLogs = async () => {
        const response = await fetch('/api/logs')
        const json = await response.json()

        if (response.ok) {
            console.log("Database Response OK")
            console.log(json)
          dispatchLogs({type: 'SET_LOGS', payload: json})
        } else {
            console.log("Database Response NOT OK")
        }
      }

      fetchLogs()
    }, [dispatchLogs])
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/studentView" element={<StudentView />}/>
          <Route path="/staffView" element={<StaffView />}/>
          {logs && logs.map(log => (
            <Route key={log._id} path={'/'+log._id} element={<StudentView log={log}/>}/>
          ))}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
